import React, {Component} from 'react';
import x_image from '../images/1.png'; 
import o_image from '../images/0.png'; 

const Info = (props) => {
  return(

    <div>
        <form onSubmit={props.handle_players_name(event.target.player_X_name.value, event.target.player_O_name.value)}>
          <label>
            Player X:
            <input type="text" name="player_X_name" />
          </label>
          <label>
            Player O:
            <input type="text" name="player_O_name" />
          </label>
          <input type="submit" value="Submit" />
    </form>


    </div>
  )
}

export default Info;
